import styled from 'styled-components'

const Outer = styled.button`
    padding: 8px;
    border-radius: 12px;
    background-color: white;
    color: black;
    border: 2px solid black;
    transition-duration: 0.4s;

    :hover {
        background-color: black;
        color: white;
        font-weight: bold;

    }

`

export default Outer
